import Footer from '../Footer Component/Component-Footer';
import '../App.css';


function Landing() {

  return (<>
    {/* <div className='header'>
        <Navbar/>
      
      
      
      </div>
      <br></br>
      <div className='carousel'>
        <Header/>
        

      </div> */}
      
        <br></br>
        <div className='landing'>
          <h1>Landing</h1>
          {NewProducts}
        </div>
      
        <div className='foot'>
          <Footer/>
        </div>
  </>)
}

export default Landing;
